INSERT INTO `companydata` VALUES (1,3,'Intel','Hardware Manufacturing','We are Intel.\n\nWe don\'t know how to 10nm.','1973-05-05','intel@rere.com','companyprofiles/cid.3/avatar/Intel_white_logo.png','United States','California','San Francisco','www.intel.com'),(2,6,'Nvidia','Hardware Manufacturing with RTX ON.\nOwning AMD everyday.','We make GPUs with RTX.','1993-04-01','nvidia@yeahboi.com','companyprofiles/cid.6/avatar/download.png','United Arab Emirates','','','http://nvidia.com'),(3,8,'AMD','Hardware Manufacturin','For nearly 50 years, AMD (NASDAQ: AMD) has driven innovation in high-performance computing, graphics, and visualization technologies â€• the building blocks for gaming, immersive platforms, and the datacenter. Hundreds of millions of consumers, leading Fortune 500 businesses, and cutting-edge scientific research facilities around the world rely on AMD technology daily to improve how they live, work, and play. \n\nFor more information about how AMD is enabling today and inspiring tomorrow, visit AMD.com.','1969-05-01','amd@reckintel.com','companyprofiles/cid.8/avatar/amd-black-logo-media-1260x709.png','United States','California','Santa Clara','http://www.amd.com'),(4,9,'Google','Internet services','Googleâ€™s mission is to organize the worldâ€˜s information and make it universally accessible and useful. \n\nSince our founding in 1998, Google has grown by leaps and bounds. From offering search in a single language we now offer dozens of products and servicesâ€”including various forms of advertising and web applications for all kinds of tasksâ€”in scores of languages. And starting from two computer science students in a university dorm room, we now have thousands of employees and offices around the world. A lot has changed since the first Google search engine appeared. But some things havenâ€™t changed: our dedication to our users and our belief in the possibilities of the Internet itself.','1998-01-01','gooogle@gulgl.com','companyprofiles/cid.9/avatar/google.png','United States','California','Mountain View','https://careers.google.com/?src=Online/LinkedIn/linkedin_profilepage&utm_source=linkedin&utm_medium=profilepage&utm_campaign=profilepage'),(13,10,'Apple','Internet Technology, Product developement & manufacturing','Weâ€™re a diverse collective of thinkers and doers, continuously reimagining our products and practices to help people do what they love in new ways. That innovation is inspired by a shared commitment to great work â€” and to each other. Because learning from the people here means weâ€™re learning from the best.','1976-04-01','apple@zabest.com','companyprofiles/cid.10/avatar/1caa032c47f63d50902b9d34492e1303.jpg','United States','California','Cupertino','https://www.apple.com/jobs/us/'),(14,11,'Samsung Electronics','Consumer Electronics','Samsung Electronics is a global leader in technology, opening new possibilities for people everywhere. Through relentless innovation and discovery, we are transforming the worlds of TVs, smartphones, wearable devices, tablets, digital appliances, network systems, medical devices, semiconductors and LED solutions. Samsung is also leading in the Internet of Things space through, among others, our Smart Home and Digital Health initiatives. \n\nSince being established in 1969, Samsung Electronics has grown into one of the worldâ€™s leading technology companies, and become recognized as one of the top 10 global brands. Our network now extends across the world, and Samsung takes great pride in the creativity and diversity of its talented people, who drive our growth.  To discover more, please visit our website at www.samsung.com and our official newsroom at news.samsung.com','1938-01-03','samsug@smug.com','companyprofiles/cid.11/avatar/0.png','Korea South','Gyeonggi Province','Suwon','http://www.samsung.com'),(15,12,'Groupe Renault','Automotive','Iconic vehicles, futuristic concepts, since 1898, Groupe Renault built itself a rich history, filled with emotions and innovation. An international adventure, written by 183 000 workers within 37 countries.','1899-02-25','reno@re.com','companyprofiles/cid.12/avatar/e5f8d0ebd65047e6e30e45299b708c35.png','France','','','http://www.group.renault.com'),(16,13,'Electronic Arts (EA)','Computer Games','Electronic Arts Inc. is a leading global interactive entertainment software company. EA delivers games, content and online services for Internet-connected consoles, personal computers, mobile phones and tablets.','1982-03-27','ea@eassss.com','companyprofiles/cid.13/avatar/EA_logo_Electronic_Arts.png','United States','California','Redwood City','http://www.ea.com'),(17,14,'Sennheiser','Electrical & Electronic Manufacturing','Sennheiser is shaping the Future of Audio - a vision built on a 70-year history of innovation and a continued drive for excellence that is woven into our companyâ€™s DNA and culture. Around the world, our employees share this passion in the pursuit of the perfect sound, creating products that exceed expectations and set new benchmarks in audio. Numerous iconic products like the invention of the first open-type headphone, the HD 414 in 1968, the MD 441 microphone in 1971 and the creation of the legendary Orpheus in 1991 bear witness to Sennheiserâ€™s unique innovative drive. Today, Sennheiser is one of the worldâ€™s leading producers of headphones, microphones and wireless transmission technology. The family-owned company operates its own plants in Germany, Ireland and the US and is active in more than 50 countries worldwide.','1945-05-29','senn@ssean.com','companyprofiles/cid.14/avatar/20170408190612_Sennheiser-CompactLogoWeb.jpg','Germany','Hesse','Hadamar','http://www.sennheiser.com'),(18,15,'IBM','Information Technology and Services','At IBM, work is more than a job - it\'s a calling: To build. To design. To code. To consult. To think along with clients and sell. To make markets. To invent. To collaborate. Not just to do something better, but to attempt things you\'ve never thought possible. To lead in this new era of technology and solve some of the world\'s most challenging problems.\n \nIBM is a leading cloud platform and cognitive solutions company. Restlessly reinventing since 1911, we are the largest technology and consulting employer in the world, with more than 350,000 employees serving clients in 170 countries. With Watson, the AI platform for business, powered by data, we are building industry-based solutions to real-world problems. For more than seven decades, IBM Research has defined the future of information technology with more than 3,000 researchers in 12 labs located across six continents. For more information, visit www.ibm.com.\n \nThis is IBM\'s official LinkedIn account and it follows IBM Social Computing Guidelines. We reserve the right to delete comments that are offensive or suggestive, personal attacks, anonymous, wildly off-topic, spam or advertisements. For more information regarding IBMâ€™s social computing guidelines, visit http://ibm.co/1LRDq6F','1911-01-02','ibm@ibmcompany.ro','companyprofiles/cid.15/avatar/0.png','United States','New York','Armonk','http://www.ibm.com'),(19,16,'Valve','Computer Games','Valve is an entertainment software and technology company founded in 1996 and based in Bellevue, Washington. The companyâ€™s debut title, Half-Life, has won over 50 Game of the Year Awards and was named \"Best PC Game Ever\"â€‹ in the November 1999, October 2001, and April 2005 issues of PC Gamer, the world\'s best-selling PC games magazine.\n\nValveâ€™s portfolio also includes titles in the award-winning Counter-Strike, Day of Defeat, Team Fortress, Left 4 Dead, Portal and Dota franchises. This portfolio of titles accounts for over 100 million units sold worldwide, and include some of the most played online games in the world.\n\nIn addition to producing best-selling entertainment titles, Valve is a developer of leading-edge technologies including the SourceÂ® game engine and SteamÂ®, a leading platform for digital content offering thousands of games to millions of users around the world. In 2015, Valve introduced the Steam Hardware devices, a collection of hardware devices designed to extend Steam beyond the desktop. In 2016, launched SteamVR, a platform for the creation and distribution of leading edge VR products.\n\nToday, Valve is composed of over 300 of the industry\'s best artists, programmers, and writers. In the company\'s history, it has risen from \"unlikely new entry\"â€‹ to industry leader, producing a string of best-selling and critically-acclaimed PC products and technologies.','1996-06-05','volvo@vvvv.com','companyprofiles/cid.16/avatar/volvo.png','United States','Washington','Bellevue','https://www.valvesoftware.com'),(20,17,'Blizzard','Video Games','Blizzard EntertainmentÂ® is a premier developer and publisher of entertainment software. After establishing the Blizzard Entertainment label in 1994, the company quickly became one of the most popular and well-respected makers of computer games. By focusing on creating well-designed, highly enjoyable entertainment experiences, Blizzard Entertainment has maintained an unparalleled reputation for quality since its inception.','1991-06-10','blizz@blizz1.com','companyprofiles/cid.17/avatar/blizz.jpg','United States','California','Irvine','https://careers.blizzard.com'),(21,18,'Facebook','Internet Technologies','Founded in 2004, Facebookâ€™s mission is to give people the power to build community and bring the world closer together. Over 2 billion people use Facebook, Instagram, WhatsApp, or Messenger every month to stay connected with friends and family, to discover whatâ€™s going on in the world, and to share and express what matters to them. \n\nFacebook is defined by our unique culture â€“ one that rewards impact. We encourage people to be bold and solve the problems they care most about. We work in small teams and move fast to develop new products, constantly iterating. The phrase â€œthis journey is 1% finishedâ€ reminds us that weâ€™ve only begun to fulfill our mission.\n\nAs we evolve our journey to bring the world closer together, we stay true to the same core values to guide the way we work and the decisions we make every step of the way: be open, be bold, move fast, focus on impact, and build social value.\n\nFor a full listing of our jobs, visit http://www.facebook.com/careers\n\nWe created this space on LinkedIn to share information about careers at Facebook. This includes employee stories, current openings, and inside looks at particular teams and initiatives. We welcome relevant comments and discussion, so please be respectful. We reserve the right to moderate content, including off-topic, inaccurate, spam comments and posts.\n\nIf you are seeking support for issues related to your Facebook account, please reference our Help Center (https://www.facebook.com/help) or Help Community (https://www.facebook.com/help/community).','2004-06-10','fb@fbfb.com','companyprofiles/cid.18/avatar/fb.png','United States','California','Menlo Park','http://www.facebook.com/careers');
