INSERT INTO `jobdata` VALUES (5005,2,'Solution Engineer - AI','The rapidly growing community of AI startups is inspired by developers who are applying their passion to create a wide range of applications and services using the latest accelerated computing technologies and platforms from NVIDIA. Key areas of application development include Deep Learning/AI, Accelerated Data Science, Autonomous Vehicles, Robotics, Design & Visualization, VR/AR, Ray Tracing, and advanced technologies changing the face of PC Gaming.\n\nWe are now looking for a dynamic, customer-minded Solution Engineer who is passionate about AI (artificial intelligence) areas such as machine learning (ML) and deep learning (DL) to join NVIDIAâ€™s developer programs team.\n\nGrowing and nurturing the ecosystem of developers who use NVIDIA platforms to lead the AI revolution is a critical mission, and this role is very tightly aligned with our strategic priorities. The role is very fast-moving and involves 1:1 and 1:few activities guiding developers in our online community or manning the â€œbat phoneâ€ to resolve specific implementations. In parallel, you will be building technical content that accelerates adoption. Weâ€™re looking for energetic and creative software engineers who want to be on the cutting edge of AI technology and are passionate about helping the rapidly expanding ecosystem of developers and AI startups build the future.\n\nWhat Youâ€™ll Be Doing\n\nMaking AI Startups successful, helping accelerate their apps/platforms using the latest SDKs and technologies\n\nCollaborating deeply with NVIDIA deep learning engineers, SDK product and framework teams, Deep Learning Institute (DLI), and NV Research to ensure developer enablement materials are best-in-class and fully aligned with technology roadmaps\n\nChampioning the use of DL (deep learning) and Data Science across the growing portfolio of AI startups\n\nDeveloping world-class materials that educate developers. Assets include sample applications, tutorials, white papers, technical blogs, trainings and presentations to help developers adopt NVIDIAâ€™s SDKs and key technologies.\n\nPromoting key technologies and SDKs including AMP, TRTIS, XGBoost, cuDNN, CUDA, DL/ML Frameworks, etc.\n\nContributing to the development of hands-on training materials and exercises used in the NVIDIA Deep Learning Institute (DLI) courses, and becoming a certified instructor\n\nWhat We Need To See:\n\n-BS/MS in Engineering, Computer Engineering, Computer Science - or equivalent experience\n\n-5+ years experience in externally facing technical role\n\n-Solid understanding of best practices for solution design and implementation based on frameworks and --platforms that are GPU-accelerated\n\n-Experience developing software at a technology company\n\n-Python or C/C++ programming and software development techniques\n\n-Detailed understanding of software stack from drivers to SDKs, APIs\n\n-Experience presenting to technical audiences and creating technical content for developers\n\n-Passionate about getting things done quickly\n\n-Excellent written and verbal communication skills\n\n-Confirmed ability to handle multiple projects simultaneously\n\n-Ability to work independently with minimal direction\n\nNVIDIA is committed to fostering a diverse work environment and proud to be an equal opportunity employer. As we highly value diversity in our current and future employees, we do not discriminate (including in our hiring and promotion practices) on the basis of race, religion, color, national origin, gender, gender expression , sexual orientation, age, marital status, veteran status, disability status or any other characteristic protected by law.#deeplearning','Other','nvidia@gege.boi','2020-05-11 12:11:17','Senior Level','United States','California','Santa Clara','active'),(5006,2,'Research Intern - Robotics','Intelligent machines powered by Artificial Intelligence computers that can learn, reason and interact with people are no longer science fiction. Today, a self-driving car powered by AI can meander through a country road at night and find its way. An AI-powered robot can build 3D maps of its environment, detect and track real-life objects, learn from simulated environments, and understand commands. This is truly an extraordinary time â€” the era of AI has begun.\n\nNVIDIA is searching for world-class Research Interns to join our Robotics Research Lab in Seattle, Washington. We are passionate about enabling robots to reach human-level dexterity, perception, and adaptability. We are building a diverse and interdisciplinary team to work on core robotics topics ranging from control and perception to task planning and critical areas related to deep learning, computer vision, and natural language processing.\n\nDo you agree with us that the most interesting thing about this revolution is building robots to take on real-life problems? If so, our team will be an excellent fit for you.\n\nWhat Youâ€™ll Be Doing\n-You will apply your experience and knowledge in areas of robotics perception, control, and relatable areas in computer vision, machine learning, and natural language processing\n-Conduct robotics research via publishing papers, speaking and attending conferences, and collaborating with external researchers\n-Partner with internal groups to transfer technologies and innovate products\n\nWhat We Need To See\n-You are pursuing a PhD (preferred) or Masters in Computer Science, Electrical Engineering, or a related discipline\n-You have shown expertise in theory and practice of robotics with a strong interest in connecting your work to robotics scenarios\n-Strong background in research with publications from top robotics and AI conferences (i.e. RSS, ICRA, CVPR, NIPS)\n-Ability to communicate effectively in a collaborative environment\n-Programming experience and proficiency in Python, MATLAB, C, and C++\n\nWays To Stand Out From The Crowd\n-Expertise in one or more of the following: robot manipulation, robot control and reinforcement learning\n-Experience and/or theoretical knowledge in computer vision, human-robot-interactions, and Artificial Intelligence\n-You are familiar with physics-based simulation and natural language processing\n-You bring experience with CUDA and deep learning frameworks (i.e TensorFlow or Torch)\n\nThis position offers you the opportunity to have real impact while working with some of the most creative and brilliant people in the world who are here at this dynamic, technology-focused company.\n\nNVIDIA is committed to fostering a diverse work environment and proud to be an equal opportunity employer. As we highly value diversity in our current and future employees, we do not discriminate (including in our hiring and promotion practices) on the basis of race, religion, color, national origin, gender, gender expression , sexual orientation, age, marital status, veteran status, disability status or any other characteristic protected by law.#deeplearning','Other','nvidia@thebest.com','2020-05-14 11:50:11','Junior Level','Romania','Bucharest','Sector 1','active'),(5008,1,'Process/Device Integration Engineer','Non-Volatile Memory Process, Integration and Yield engineers are responsible for leading research and development in order to architect, develop and deliver leading edge non-volatile memory technologies to high volume manufacturing.\n\n-They contribute to defining process and device architectures, technology collateral as well as develop scaling -paths for leading edge memory technologies.\n-The scope includes development of new types of process and device architectures involving novel materials, structures and integration schemes to deliver industry leadership in density, performance, reliability and cost.\n-They collaborate with technology development partners in defining goals, developing the vision, aligning strategy and driving fast paced silicon development to meet aggressive technology node cadences.\n-In addition they work closely with the product and system teams to ensure seamless integration of the memory components into Intel\'s system products as well as with the manufacturing Fabs to ensure a seamless technology transfer and ramp to support the full envelope of component and system products.\n\nQualifications\n-MS or PhD degree in Electrical Engineering, Materials Science, Physics, Chemistry or Chemical Engineering\n-8+ years of experience in process development and integration or yield analysis.\n-You should have a minimum of 8 years\' experience in the following areas: -\n-Direct experiences in yield, integration, device or process engineering organizations. -\n-Data extraction and analysis skills, and well versed in DOE principles. -\n-Understanding of device physics in deciphering parametric data and understanding of fundamental integration and yield issues for key modules and critical device parameters.\n\nPreferred Qualifications:-\n-Experience integrating novel material systems into semiconductor devices or memory devices\nInside this Business Group\n\nNon-Volatile Solutions Memory Group: The Non-Volatile Memory Solutions Group is a worldwide organization that delivers NAND flash memory products for use in Solid State Drives (SSDs), portable memory storage devices, digital camera memory cards, and other devices. The group is responsible for NVM technology design and development, complete Solid State Drive (SSD) system hardware and firmware development, as well as wafer and SSD manufacturing.\n\nPosting Statement\n\nAll qualified applicants will receive consideration for employment without regard to race, color, religion, religious creed, sex, national origin, ancestry, age, physical or mental disability, medical condition, genetic information, military and veteran status, marital status, pregnancy, gender, gender expression, gender identity, sexual orientation, or any other characteristic protected by local law, regulation, or ordinance....','Quality Assurance','intel@rere.com','2020-05-19 08:44:16','Mid-Senior Level','United States','New Mexico','Albuquerque','active'),(5009,3,'CPU Design Verification Engineer','What You Do At AMD Changes Everything\n\nAt AMD, we push the boundaries of what is possible. We believe in changing the world for the better by driving innovation in high-performance computing, graphics, and visualization technologies â€“ building blocks for gaming, immersive platforms, and the data center.\n\nDeveloping great technology takes more than talent: it takes amazing people who understand collaboration, respect, and who will go the â€œextra mileâ€ to achieve unthinkable results. It takes people who have the passion and desire to disrupt the status quo, push boundaries, deliver innovation, and change the world. If you have this type of passion, we invite you to take a look at the opportunities available to come join our team.\n\nCPU Design Verification Engineer\n\nThe Role\n\nIn this position, you will perform pre-silicon Functional Verification of next generation high performance Microprocessor designs. It involves developing testplans, writing directed and random tests, checkers, bus functional models, debugging fails and improving tools and infrastructure.\n\nThe Person\n\nWe are searching for candidates who love technical challenges and are natural problem solvers. Detail oriented people who seek continuous improvement and enjoy innovation are encouraged to apply.\n\nKey Responsibilities\n\nYou will be responsible to verify new microarchitectural features being added in AMDâ€™s next generation high performance core and will be involved in developing testbench components, behavioral models, BFMS, monitors, checkers and coverage terms using C++/SystemVerilog. You will also be responsible to develop and execute on verification test plans at different levels of design hierarchy including unit and full-chip environments, simulate and debug directed and random stimulus and assembly level tests to find bugs in the microprocessor design and verify the functionality and conformance to the ISA.\n\nAdditional Responsibilities Include -\n- Work with RTL writers to resolve all simulation failures and discrepancies\n- Document test plans and testbench component plans and drive reviews with peers and partners\n- Develop and analyze assertions and coverage terms. Participate in technical reviews of the specifications, design and test plans. Identify and address areas of concern to meet design quality objectives\n- Develop tools, infrastructure, processes and flows to enable functional verification\n- Maintain and improve existing functional verification infrastructure and methodology\n- When presented with Silicon issues, replicate in the pre-silicon environment and provide debug expertise to root cause the issue and ensure complete validation\n- Contribute towards and drive as needed pre-silicon and/or post-silicon verification of complex architectural and microarchitectural features\n- Drive project goals and dependencies with cross-site Architects, RTL writers, and Physical Design engineers\nIndependently develop quality, timely and cost effective solutions.\n\n\nPreferred Experience\n\nWe are looking for people with experience in CPU level design verification. A strong background with C++, SystemVerilog, UVM, Computer Architecture and coding skills are essential.\n\nOther Skills Include -\n- Strong knowledge of microprocessor pipeline and memory hierarchy\n- Hands-on work in C++ programming for either hardware modeling or testbench development or projects of similar scope and complexity\n- Logic design and representing the same in HDL (e.g. Verilog or VHDL)\n- Assembly language programming and Instruction Set Architecture of a current microprocessor\n- Hardware Verification methodology and techniques such as simulation, debug, coverage, formal, etc.\n- Experience working in a Unix/Linux environment\n- Experience in scripting languages (e.g. Perl or Python or Ruby)\n- Experience in hardware/logic simulators (e.g. VCS or NC-Verilog)\n- Experience in debug tools or waveform viewers\n- Experience in Verification languages (e.g. Specman or System Verilog)\n\n\nAcademic Credentials\nMSEE, MSCE or related degree\n\n\nRequisition Number: 78813\nCountry: United States State: California City: Santa Clara\nJob Function: Design','Design','amd@reeere.com','2020-05-14 19:09:42','Mid-Senior Level','United States','California','Santa Clara','active'),(5010,3,'CPU Design Verification Engineer','What You Do At AMD Changes Everything\n\nAt AMD, we push the boundaries of what is possible. We believe in changing the world for the better by driving innovation in high-performance computing, graphics, and visualization technologies â€“ building blocks for gaming, immersive platforms, and the data center.\n\nDeveloping great technology takes more than talent: it takes amazing people who understand collaboration, respect, and who will go the â€œextra mileâ€ to achieve unthinkable results. It takes people who have the passion and desire to disrupt the status quo, push boundaries, deliver innovation, and change the world. If you have this type of passion, we invite you to take a look at the opportunities available to come join our team.\n\nCPU Design Verification Engineer\n\nThe Role\n\nIn this position, you will perform pre-silicon Functional Verification of next generation high performance Microprocessor designs. It involves developing testplans, writing directed and random tests, checkers, bus functional models, debugging fails and improving tools and infrastructure.\n\nThe Person\n\nWe are searching for candidates who love technical challenges and are natural problem solvers. Detail oriented people who seek continuous improvement and enjoy innovation are encouraged to apply.\n\nKey Responsibilities\n\nYou will be responsible to verify new microarchitectural features being added in AMDâ€™s next generation high performance core and will be involved in developing testbench components, behavioral models, BFMS, monitors, checkers and coverage terms using C++/SystemVerilog. You will also be responsible to develop and execute on verification test plans at different levels of design hierarchy including unit and full-chip environments, simulate and debug directed and random stimulus and assembly level tests to find bugs in the microprocessor design and verify the functionality and conformance to the ISA.\n\nAdditional Responsibilities Include -\n\n- Work with RTL writers to resolve all simulation failures and discrepancies\n\n- Document test plans and testbench component plans and drive reviews with peers and partners\n\n- Develop and analyze assertions and coverage terms. Participate in technical reviews of the specifications, design and test plans. Identify and address areas of concern to meet design quality objectives\n\n- Develop tools, infrastructure, processes and flows to enable functional verification\n\n- Maintain and improve existing functional verification infrastructure and methodology\n\n- When presented with Silicon issues, replicate in the pre-silicon environment and provide debug expertise to root cause the issue and ensure complete validation\n\n- Contribute towards and drive as needed pre-silicon and/or post-silicon verification of complex architectural and microarchitectural features\n\n- Drive project goals and dependencies with cross-site Architects, RTL writers, and Physical Design engineers\n\nIndependently develop quality, timely and cost effective solutions.\n\nPreferred Experience\n\nWe are looking for people with experience in CPU level design verification. A strong background with C++, SystemVerilog, UVM, Computer Architecture and coding skills are essential.\n\nOther Skills Include -\n\n- Strong knowledge of microprocessor pipeline and memory hierarchy\n\n- Hands-on work in C++ programming for either hardware modeling or testbench development or projects of similar scope and complexity\n\n- Logic design and representing the same in HDL (e.g. Verilog or VHDL)\n\n- Assembly language programming and Instruction Set Architecture of a current microprocessor\n\n- Hardware Verification methodology and techniques such as simulation, debug, coverage, formal, etc.\n\n- Experience working in a Unix/Linux environment\n\n- Experience in scripting languages (e.g. Perl or Python or Ruby)\n\n- Experience in hardware/logic simulators (e.g. VCS or NC-Verilog)\n\n- Experience in debug tools or waveform viewers\n\n- Experience in Verification languages (e.g. Specman or System Verilog)\n\nAcademic Credentials\n\nMSEE, MSCE or related degree\n\nRequisition Number: 78813\n\nCountry: United States State: California City: Santa Clara\n\nJob Function: Design','Design','amd@reee.com','2020-05-14 18:56:54','Mid-Senior Level','United States','California','Santa Clara','inactive'),(5011,4,'Program Lead, Executive and Customer Engagement, Google Cloud','Note: By applying to this position your application is automatically submitted to the following locations: London, UK; Dublin, Ireland\n\nMinimum Qualifications\n- Experience in technology sales to C Suite.\n- Experience with account planning and running strategic customer initiatives at regional level.\n- Experience in customer relationship management and prioritizing trade-offs.\n\n\nPreferred Qualifications\n- Extensive experience in Public Relations and brand management\n- Ability to collaborate with cross-functional leadership teams with experience in conflict resolution and negotiations in a matrix organization experiencing hyper growth\n- Excellent project management skills with distinctive problem-solving experience executing complex strategic and operational initiatives\n- Comfortable with fast paced changes and the ability create fluid frameworks\n- Influence and consensus building as this role requires extensive cross functional and cross-geo orchestration with prior experience working closely with C-Level Executives\n\n\nAbout The Job\n\nThe Business Strategy & Operations organization provides business critical insights using analytics, ensures cross functional alignment of goals and execution, and helps teams drive strategic partnerships and new initiatives forward. We stay focused on aligning the highest-level company priorities with effective day-to-day operations, and help evolve early stage ideas into future-growth initiatives.\n\nAs Program Lead of Executive and Customer Engagement, you will play a pivotal role in Google Cloud EMEAâ€™s strategy to drive accelerated penetration in our most strategic accounts. You\'ll own and program manage our highest impact initiatives such as CEO and President interactions with high potential customers, executive sponsorship programmes, high potential accounts, mega deal prospects and emerging digital native start ups. The role is a high visibility - high impact role that manages the most strategic parts of our business.\n\nGoogle Cloud helps millions of employees and organizations empower their employees, serve their customers, and build whatâ€™s next for their business â€” all with technology built in the cloud. Our products are engineered for security, reliability and scalability, running the full stack from infrastructure to applications to devices and hardware. And our teams are dedicated to helping our customers and developers see the benefits of our technology come to life.\n\nResponsibilities\n- Define and programme manage the Executive Engagement and Customer Programs strategy for Google Cloud EMEA - overall, for strategic accounts, for mega deals, for emerging digital natives\n- Create an EMEA specific framework aligned with the EMEA strategy to integrate cross organisational customer outreach initiatives to amplify effectiveness at an account level and own the key result area for penetration in our most strategic accounts\n- Work closely with sub-regional leadership to drive strong customer engagement programmes in their sub region aligned with the EMEA Customer Engagement Strategy\n- Define and own the account planning process in collaboration with sub-regional leadership for the most strategic accounts ensuring that account plans reflect our tangible path to be the strategic digital transformation partner of choice for our high priority customers\n- Own the key result area of executive to executive relationship strength\n\nAt Google, we donâ€™t just accept differenceâ€”we celebrate it, we support it, and we thrive on it for the benefit of our employees, our products and our community. Google is proud to be an equal opportunity workplace and is an affirmative action employer. We are committed to equal employment opportunity regardless of race, color, ancestry, religion, sex, national origin, sexual orientation, age, citizenship, marital status, disability, gender identity or Veteran status. We also consider qualified applicants regardless of criminal histories, consistent with legal requirements. See also Google\'s EEO Policy and EEO is the Law. If you have a disability or special need that requires accommodation, please let us know by completing this form .','Other','gooogle@gigi.com','2020-05-15 16:29:05','Mid-Senior Level','United Kingdom','London Borough of Barnet','Laceby','active'),(5012,4,'Technical Editor, Google Cloud Platform','Minimum Qualifications\n- Experience editing and managing technical content.\n- Experience with information architecture and content management systems.\n- Experience building collaborative partnerships (e.g. with cross-functional and/or external stakeholders).\n\n\nPreferred Qualifications\n- Bachelor\'s degree or equivalent practical experience.\n- Familiarity with Google Cloud Platform.\n- Demonstrated HTML and CSS or Markdown skills.\n\n\nAbout The Job\n\nTechnical writers communicate complex information clearly, concisely and accurately, and without relying on jargon. As a technical writer, your role involves tasks such as writing conceptual overviews and procedures, reading and writing example code, or updating help center queries and FAQs. Technical writers play a big part at Google. They are a key link between engineers, marketing associates, developer advocates, as well as all the external users and developers, tying together many vital but disparate parts of the Google ecosystem.\n\nAs a technical editor on our team, you edit tutorials, conceptual material, and architectural diagrams targeted at software developers and IT pros who want to use Google Cloud Platform (GCP). Your primary authors are field sales engineers and solutions architects. You will transform drafts they create for business engagements and conference presentations into polished technical documentation. You also provide guidance to a team of professional technical writers who are creating GCP product docs, including giving input and direction on doc types, content model, style, terminology, and site design.\n\nGoogle Cloud helps millions of employees and organizations empower their employees, serve their customers, and build whatâ€™s next for their business â€” all with technology built in the cloud. Our products are engineered for security, reliability and scalability, running the full stack from infrastructure to applications to devices and hardware. And our teams are dedicated to helping our customers and developers see the benefits of our technology come to life.\n\nResponsibilities\n- Edit technical content for developers (Google Cloud Platform customers and prospective customers).\n- Edit writers for adherence to globalization and localization standards.\n- Edit first-time writers and build writer/editor relationships.\n- Work closely with the development, sales, marketing teams, partners, and other internal groups.\n- Understand, know, and update standards, templates, editorial guidelines, and globalization best practices.\n\nAt Google, we donâ€™t just accept differenceâ€”we celebrate it, we support it, and we thrive on it for the benefit of our employees, our products and our community. Google is proud to be an equal opportunity workplace and is an affirmative action employer. We are committed to equal employment opportunity regardless of race, color, ancestry, religion, sex, national origin, sexual orientation, age, citizenship, marital status, disability, gender identity or Veteran status. We also consider qualified applicants regardless of criminal histories, consistent with legal requirements. See also Google\'s EEO Policy and EEO is the Law. If you have a disability or special need that requires accommodation, please let us know by completing this form .','Marketing, Public Relations, Writing/Editing','google@gegee.com','2020-05-29 14:27:42','Junior Level','Sweden','SkÃ¥ne County','Ã„ngelholm','active'),(5013,4,'Senior Software Engineer, Engineering Productivity','Minimum Qualifications\n- Bachelor\'s in Computer Science or related technical field or equivalent practical experience.\n- Experience working on and leading projects in two or more of the following: application development, Unix/Linux environments, distributed/parallel systems, machine learning, natural language processing, networking and/or software systems.\n- Ability to speak and write in English fluently and idiomatically.\n\n\nPreferred Qualifications\n- Technical Leading experience.\n- Experience building developer tools that improve developer velocity, code quality and code health.\n- Experience in Android Mobile application development using Android Java.\n\n\nAbout The Job\n\nA line of code can be many things - an amazing feature, a beautiful UI, a transformative algorithm. The faster this line of code reaches millions of users, the sooner it impacts their lives. As a Software Engineer, Tools and Infrastructure, you will be at the heart of Googleâ€™s engineering process building software that empowers engineering teams to develop and deliver high quality products quickly. We are focused on solving the hardest, most interesting challenges of developing software at scale without sacrificing stability, quality, velocity or code health.\n\nWe ensure Google\'s success by partnering with engineering teams and developing scalable tools and infrastructure that help engineers develop, test, debug and release software quickly. We impact thousands of Googlers and billions of users by increasing the pace of product development and ensuring our products are thoroughly tested. We are advocates for code health, testability, maintainability and best practices for development and testing.\n\nHaving access to all of Google\'s platforms and vast compute resources provides a unique opportunity to grow as an engineer. We typically work in small, nimble teams that collaborate on common problems across products and focus areas. As a result, the exposure to this broad set of problems provides diverse technical challenges as well as accelerated career growth.\n\nAs a Software Engineer, you\'ll be a provider of high-quality products (tools and solutions) for Search and Assistant Mobile, building tools and infrastructure that improve Developer Velocity, Code Quality, and measure Success Metrics.\n\nGoogle is and always will be an engineering company. We hire people with a broad set of technical skills who are ready to take on some of technology\'s greatest challenges and make an impact on millions, if not billions, of users. At Google, engineers not only revolutionize search, they routinely work on massive scalability and storage solutions, large-scale applications and entirely new platforms for developers around the world. From Google Ads to Chrome, Android to YouTube, Social to Local, Google engineers are changing the world one technological achievement after another.\n\nResponsibilities\n- Help create the next generation of tools and infrastructure for build, test, release and monitoring of Android Search Application, focusing on developer productivity, release velocity and product quality.\n- Work on backend components related to the Mobile Applications developer ecosystem.\n- Automate repeated tasks and build test coverage through existing or new infrastructure.\n- Improve on build infrastructure to make builds faster and more reliable and optimize mobile developer workflow for velocity and reliability.\n- Develop automatic tools that catch performance regression changes and provide analytics to measure the efficacy of our testing efforts, build velocity and the overall health of our code.\n\nAt Google, we donâ€™t just accept differenceâ€”we celebrate it, we support it, and we thrive on it for the benefit of our employees, our products and our community. Google is proud to be an equal opportunity workplace and is an affirmative action employer. We are committed to equal employment opportunity regardless of race, color, ancestry, religion, sex, national origin, sexual orientation, age, citizenship, marital status, disability, gender identity or Veteran status. We also consider qualified applicants regardless of criminal histories, consistent with legal requirements. See also Google\'s EEO Policy and EEO is the Law. If you have a disability or special need that requires accommodation, please let us know by completing this form .','Engineering, Information Technology','google@itit.com','2020-05-30 09:58:59','Junior Level','Australia','Queensland','Burke','active'),(5014,13,'Commercial Development Manager','The Retail Market Development team is looking for a Commercial Development Country Manager, covering the Americas. The Retail Market Development team is responsible for identifying, developing, implementing and driving revenue programs that attract new customers and drive affinity to Apple.\n\nAs Retail Commercial Manager you will be responsible for driving the commercial success of Apple Retail stores within your markets. You will leverage your Apple experience, market knowledge and analytical skill set to develop effective commercial plans that align with Apple Retailâ€™s priorities.\n\nWe are looking for a strategic individual with deep problem solving competencies, a strong commercial drive and outstanding relationship skills.\n\nKey Qualifications\n\nKey responsibilities:\n- Be the market expert: market trends, risk and opportunities, local consumer behavior, country plans.\n- Drive Retail Stores sales performance: Field-facing weekly engagement, QBR, sales forecasts, trend and competitive market analysis.\n- Drive program and promotion performance including Trade In, Connected iPhone, Monthly Payments, Seasonal offers, and other major Apple Retail programs.\n- Apply Retail sales programs and performance trends expertise to increase sales productivity across all products within your markets.\n- Contribute to executive-facing presentations and updates for the Retail Leadership Team including annual business plans, quarterly priorities, and KPI performance.\n- Own relationships with Senior Market Director, Market Directors, and other cross-functional teams such as Sales, Product Marketing and Operations within Apple.\n- Engage with key Retail partners from Finance, Retail Marketing, Retail Operations, Digital Commerce, Retail Contact Centers and Store Support Teams to develop, deploy and drive sales strategies.\n- Collaborate with key partners in other Apple sales channels, including Reseller, Carrier, Enterprise, iTunes and -Marcom teams to build complementary strategies\n\nDescription,Skills & Requirements\n\nMinimum of 5-7 years of relevant Industry experience\n\n- Demonstrated ability to be a self-starter and deal with ambiguity\n- Strong partnership and relationship management skills\n- An aptitude to quantify and support conclusions with analytic data\n- Strong communication skills and the ability to thrive in a highly cross-functional environment\n- Attention to detail and ability to manage complex processes comfortably\n- Highly collaborative, works well across all levels of a matrixed organization\n- Ability to make decisions in a timely manner, sometimes with incomplete information and under tight deadlines.\n- Strong presentation skills in formal and informal settings\n\nEducation & ExperienceBA required / MBA preferred or equivalent industry experience.','Business Development, Sales','apple@zabestest.com','2020-05-27 10:12:16','Junior Level','United States','Kansas','Leawood','active'),(5015,14,'SoC Hardware Architect','Title: SoC Hardware Architect \n\nReq ID#: DSA32834\n\nOVERVIEW & IMPACT\n\nThe Technology Enabling and Development (TED) Lab is part of Samsungâ€™s Memory Business Unit, the industry\'s technology and volume leader in DRAM, NAND Flash, and SRAM memory.  TED has the charter to develop SSD for enterprise customers. More recently, TED has also been tasked to develop SSD controller architecture to support future enterprise SSD designs. We are an integral part of Samsungâ€™s strong R&D focus & lab innovation engine. We work closely with development teams across geographically distributed sites to bring innovation to enterprise SSD product road maps.\n\nThe candidate will be a key technical member of TED Controller Architecture Team.  He or she will join a team of experts in researching and developing innovative data center/cloud networking, storage, and compute ASIC/FPGA and system solutions. The successful candidate will be engage collaboratively across the company with HW design and verification teams. The primary focus will be on developing, enhancing, and correlating SoC HW architecture for Samsungâ€™s SSD Controller SoC. It includes detail architecture defining with micro-architecture document publish. Ideal candidates should have strong on RTL design and P&R implementation, with expertise in Host interface (e.g, PCIe/NVMe/Gen-Z/CXL/OpenCAPI/Ethernet), CPUs, DRAM, Flash components controllers, cache controllers and interconnect.\n\nWe are looking for a SoC HW architect with a passion to develop and document new and innovative ideas and to demonstrate their value and impact.\n\nJOB RESPONSIBILITIES\n\n- Define detail micro-architecture with other SoC architect\n- Publish micro-architecture document and collaborate with RTL design & verification engineers.\n- Analyze legacy designs for bottlenecks and determine power / performance / reliability / robustness enhancements.\n- Work closely with architects / HW&SW engineers for implementation, integration, and testplan development and execution\n \n\nREQUIRED SKILLS\n\n- MS, PhD candidate in EE/CS/CE or 5-10 years of related professional experience\n- Experience of SoC bus, interconnect, CPU, host interface, and memory technologies\n- Experience of VLSI design and verification\n- Experience with high-performance, low power microarchitecture concepts\n- Familiarity with ASIC, computer and embedded system architecture\n- Excellent written and verbal communication, excellent organization skills, and highly self-motivated.\n- Strong working knowledge of RTL design, back-end process for ASIC, verification and P&R implementation.\n- Ability to summarize performance data and communicate issues effectively\n \n\nPREFERED SKILLS\n\n- Excellent scripting and automation of workflows, in C/C++ and/or Python.\n- Experience of storage related project with NVMe, PCIe, and NAND control.\n- Advanced methodology like systemVerilog-OVM or systemVerilog-UVM\n- Statistical analysis\n- Scripting (esp Python / R)\n\n***************************************************************************************\nSamsung Semiconductor Inc. (SSI), an equal opportunity employer, is a world leader in Memory, System LSI, and LCD technologies. Headquartered in San Jose, California, SSI is a wholly-owned U.S. subsidiary of Samsung Electronics Co., Ltd. - the second largest semiconductor manufacturer in the world and the industry\'s volume and technology leader in DRAM, NAND Flash, SSDs, mobile DRAM and graphics memory. It is one of the largest providers of system logic, imaging and LED lighting solutions, as well as providing advanced process design and manufacturing for fabless companies. Samsung Semiconductor, Inc. also has a research and innovation center with numerous labs providing product design and research in: logic, memory, image sensors, displays and mobile technologies. In addition, the company supports Samsung Display Company, the largest producer of LCD and OLED displays.','Engineering','smug@smaug.com','2020-05-18 13:34:02','Mid-Senior Level','France','Paris','Palaja','active'),(5016,14,'Senior Performance Analysis Engineer','Job Title : Senior Performance Analysis Engineer\n\nReq ID: DSA33046\n\nJob Description Summary\n\nSamsung Semiconductor, Inc. is a world leader in Memory and Storage technologies. We are currently looking for an experienced Senior Performance Analysis Engineer to join our team in San Diego, CA. You will contribute to memory and storage system research and development in the Memory Software Lab. You will join a team of experts in researching and developing innovative memory and storage system solutions that utilize existing and emerging technologies to add substantial value to storage systems. The ideal candidate must have experience testing and analyzing performance across hardware (CPU, DRAM, storage) and software (OS, drivers, and applications.)\n\n\nKey Responsibilities\n\n\n- Design performance measurement methodology for enterprise class storage systems\n- Develop fully repeatable benchmark test suites that measure CPU, DRAM, NVMe SSD storage performance\n- Analyze behavior of various types of storage systems (SAN, DAS, disaggregated) under various application workloads (database (SQL and NoSQL), object storage)\n- Instrument high performance software to collect vital performance data for detailed analysis\n- Present findings that can be shared across the business\n- Create white papers detailing performance findings\n \nRequired Skills and Qualifications\n\n- BS, MS, or PhD in Computer Science, Computer Engineering, or related technical field\n- 4+ years industry experience developing benchmark test suites for enterprise class software/ system storage performance measurement\n- Experience programming in one or more of the following: Python, Java, C/C++, Shell scripting (PowerShell and/or Bash)\n- Thorough understanding of Linux and Windows performance analysis tools\n- Experience in systems performance debugging and analysis\n- Strong Linux administration skills\n- Excellent analytical and communication skills\n \n\n\nPreferred Skills and Qualifications\n\n\n- Experience with monitoring/time series data collection software (Prometheus, Graphite, etc.)\n- DevOps methodology a big plus\n- Experience with configuration management and application deployment automation (Ansible)\n- Experience using Jenkins server to manage software build/test/delivery/deployment\n- Experience with 1 or more of the following NoSQL Databases: Redis, MongoDB, Cassandra, Couchbase\n \n\n\nSamsung Semiconductor Inc. (SSI), an equal opportunity employer, is a world leader in Memory, System LSI, and LCD technologies. Headquartered in San Jose, California, SSI is a wholly-owned U.S. subsidiary of Samsung Electronics Co., Ltd. - the second largest semiconductor manufacturer in the world and the industry\'s volume and technology leader in DRAM, NAND Flash, SSDs, mobile DRAM and graphics memory. It is one of the largest providers of system logic, imaging and LED lighting solutions, as well as providing advanced process design and manufacturing for fabless companies. Samsung Semiconductor, Inc. also has a research and innovation center with numerous labs providing product design and research in: logic, memory, image sensors, displays and mobile technologies. In addition, the company supports Samsung Display Company, the largest producer of LCD and OLED displays.','Engineering','samsug@smug.com','2020-05-18 13:39:35','Mid-Senior Level','United States','California','San Jose','active'),(5017,15,'DevOps Engineer','Supports the te