esign the worldâ€™s best games, broker the next strategic partnership, and market to the next generation of gamers.\n\nFor our Assistant Producer Internship, we are looking for someone who is:\n\n- Passionate about video game industry past, present and future\n- An avid gamer with knowledge about different genres\n- Enrolled in a Bachelorâ€™s or Master\'s degree in an University in any related fields such as Computer Science, Business Administration or others at the moment of your application\n- Problem-solver with strong organizational, time and management skills\n- MS Office proficient (Outlook, Project, PowerPoint, Excel)\n- Excellent communicator and proficient in English\n\nWe Thought That You May Want To Know About\n\nLocation: Bucharest, Romania\n\nWorking Schedule\n\nApril â€“ June â€“ Part-time working hours (flexible and to be confirmed) and\n\nJuly â€“ September â€“ Full-time working schedule','Project Management ,Information Technology, Product Management','ea@eallsa.com','2020-05-19 08:12:11','Junior Level','Romania','Bucharest','','active'),(5019,16,'MPA: Lead, EU EA Games Community Activation','The Community Engagement Team connects the voices of EAâ€™s 300+ million players to our global game and strategy teams, facilitating healthy conversation working together to build thriving communities. The Lead, EU Games Community Activation will lead the Global Core Community Engagement strategy for all EA EU-based studios, while also playing a contributing role in broader Activation Team initiatives, utilizing Community expertise to contribute to programs that drive results for enterprise-wide goals.\n\nAs part of this role, the Lead, EU Games Core Community will oversee a team of Community Managers driving a direct-to-play communications strategy across some of EAâ€™s biggest games and communities, including Battlefield and Need for Speed, as well as new EA Original titles. This will include programs across internal and external channels (social, forums, live streams, etc.), managing global budgets, creating a framework for consistent community-to-development feedback, and leading DICE and Criterion studioâ€™s strategy for EAâ€™s player influencer program. In addition, the Lead, Core Community will work with Community Activation Team leads on key external and internal enterprise-wide initiatives, partnering with stakeholders across the organization on programs such as EAâ€™s Building Healthy Communities Initiative.\n\nPassion is the fuel that drives our teams. The ideal candidate will have a deep love of EA and DICE Studio games, matched with community engagement expertise, people leadership skills and strong ability to develop communications strategies that drive business results - to strengthen overall player engagement and sentiment for the franchise across the world.\n\nResponsibilities\n- Lead the community strategy and long term direct-to-player communications vision for EA EU Studios games, including major brands such as Battlefield, Star Wars Battlefront and Need for Speed\n- Manage a team of Community Managers working on DICE, Criterion and EA Original titles, ensuring they are working against EAâ€™s Core Community and Building Healthy Community Standards\n- Build and maintain a strong network of partners both in studio and around the organization to help drive the EU Games Community Activation strategy, with partners including the development, brand, MarCom Activation, finance, legal and other key stakeholders.\n- Oversee EAâ€™s key Core Community direct-to-player communications initiatives including Studio DIRECT, anchor platforms (blogs, forums, social, live streams) and ensure global alignment across all stakeholders\n- Partner with regional MarCom activation leaders to ensure all EA EU games are mapping to one global plan, leading a long-term framework to ensure alignment across all Community team members\n- Drive EAâ€™s player influencer program (Game Changers) for the EA EU Games studios, in collaborati