es inside and out, and to work with top developers like Sledgehammer, Treyarch, Infinity Ward, and Vicarious Visions.\n\nSuccessful candidates will demonstrate superior programming and problem-solving skills, and will be self-motivated and reliable.\n\nPlayer Profile\n\n- Working knowledge of C++\n- Experience with network programming (TCP, UDP, security, NAT, etc.), client/ server architecture, database development experience.\n- Practical facility in a language such as LUA, Python or Java is helpful\n- Own, operate and support the services and features you develop\n- Implementing features deep within game-specific engines\n- Troubleshoot online and multiplayer features\n- Degree in Computer Science, Computer Engineering or equivalent program\n- Please include the link to your code samples along with your resume.\n\nOur World\n\nActivision Blizzard, Inc. (NASDAQ: ATVI), is one of the world\'s largest and most successful interactive entertainment companies and is at the intersection of media, technology and entertainment. We are home to some of the most beloved entertainment franchises including Call of DutyÂ®, World of WarcraftÂ®, OverwatchÂ®, DiabloÂ®, Candy Crushâ„¢ and Bubble Witchâ„¢. Our combined entertainment network delights hundreds of millions of monthly active users in 196 countries, making us the largest gaming network on the planet!\n\nOur ability to build immersive and innovate worlds is only enhanced by diverse teams working in an inclusive environment. We aspire to have a culture where everyone can thrive in order to connect and engage the world through epic entertainment. We provide a suite of benefits that promote physical, emotional and financial well-being for â€˜Every Worldâ€™ - weâ€™ve got our employees covered!\n\nThe videogame industry and therefore our business is fast-paced and will continue to evolve. As such, the duties and responsibilities of this role may be changed as directed by the Company at any time to promote and support our business and relationships with industry partners.\n\nActivision is an Equal Opportunity Employer. All qualified applicants will receive consideration for employment without regard to race, color, religion, sex, sexual orientation, gender identity, gender expression, national origin, protected veteran status, or any other basis protected by applicable law and will not be discriminated against on the basis of disability.','Engineering  Information Technology','blizz@blizz1.com','2020-06-10 10:24:26','Junior Level','United States','California','Sherman Oaks','active'),(5026,20,'Software Development Engineer in Test (SDET), B&OP, Ecommerce','The Battle.net & Online Products organization is home to 300+ superpowered engineers, program managers, and designers focused on the technology that powers Blizzard Entertainmentâ€™s games. Whether youâ€™re playing one of our titles, chatting with friends, or just shopping online, B&OP ensures that our players are immersed in engaging, exciting, and secure experiences.\n\nThe infinite care and loving detail put into every aspect of our games and systems is something we take seriously and pride ourselves on delivering to our players. Are you passionate about creating test automation, test frameworks and testing tools? Are you up for the challenge of joining a highly collaborative team while improving your professional skill set? Do you have a strong desire to work on a team and to contribute in meaningful ways with like-minded people?\n\nBlizzard QA is a close-knit team that cares about iteration, collaboration, and succeeding together. We share knowledge and improve our skills by learning from each otherâ€™s success and failures via group discussions, mentoring, and embracing techniques that keep us delivering quality entertainment. In this position you will help build and maintain tools used in development every day. Are you excited about the prospect of joining our team and being a part of Blizzard Entertainment?\n\nCovid-19 Hiring Update: Weâ€™ve transitioned to a work-from-home model and weâ€™re continuing to interview and hire during this time. This role is expected to begin as a remote position. We understand each personâ€™s circumstances may be unique and will work with you to explore possible interim options.\n\nResponsibilities\n- Collaborate with Blizzard teams to develop test plans, understand risk-based testing, and establish quality goals\n- Identify, design, and deliver technical solutions (frameworks, tests, API hooks, tools) increasing test effectiveness and coverage, while reducing cost of test execution\n- Implement metrics, analyze test data and results to identify patterns, report on risk status to development partners and influence software quality\n- Mentor other engineers and provide technical guidance to individuals and teams\n- Share insights, solutions and best practices within the team and across Blizzard\n\nRequirements\n- 5+ years of experience as a Tester, QA Engineer, SDET, Software Engineer or similar role with focus on quality\n- 4+ years software engineering experience in a professional environment\n- Fluency in Java\n- Experience with API testing and microservices\n- Experience with CICD development and tools\n- Experience in the architecture and creation of automation frameworks, test harnesses and/or QA focused tools\n- Experience interpreting large data sets and/or creating data analysis tools\n- Commitment to quality and sustainable software development\n- Bachelorâ€™s Degree in Computer Science or equivalent experience\n\nPluses\n- Experience with enterprise software automation solutions\n- Experience working with multiple platforms such as Windows, Mac, Consoles, iOS and Android\n- Experience with testing e-commerce related systems\n\nBlizzard Entertainment is a global company committed to growing our employees along with the business. We offer generous benefits and perks with an eye on providing true work / life balance. Weâ€™ve worked hard to champion an intensely collaborative and creative environment, a diverse and inclusive employee culture, and training and opportunity for professional growth. Our people are everything. Our core values are real, and our mission has never changed.\n\nWe are an equal opportunity employer and value diversity at our company. We do not discriminate on the basis of race, religion, color, national origin, gender, sexual orientation, age, marital status, veteran status, or disability status. We are dedicated to creating the most epic entertainment experiencesâ€¦ever. Join us!','Engineering, Information Technology','blizz@blizz1.com','2020-06-10 10:28:06','Senior Level','United States','California','Irvine','active'),(5027,21,'Front End Engineer','            Facebook\'s mission is to give people the power to build community and bring the world closer together. Through our family of apps and services, we\'re building a different kind of company that connects billions of people around the world, gives them ways to share what matters most to them, and helps bring people closer together. Whether we\'re creating new products or helping a small business expand its reach, people at \n            Facebook are builders at heart. Our global teams are constantly iterating, solving problems, and working together to empower people around the world to build community and connect in meaningful ways. Together, we can help people build stronger communities - we\'re just getting started.\n            Are you interested in building products used by more than a billion people? Do you like shipping code at a rapid pace? Facebook is seeking an experienced Front End Engineer that is passionate about building mobile and desktop web applications. This position is full-time and is based in our Menlo Park office.\n\n- Implement the features and user interfaces of Facebook products like News Feed\n- Architect efficient and reusable front-end systems that drive complex web applications\n- Collaborate with Product Designers, Product Managers, and Software Engineers to deliver compelling user-facing products\n- Identify and resolve performance and scalability issues\n- 5+ years of JavaScript experience, including concepts like asynchronous programming, closures, types, and ES6\n- 5+ years of HTML/CSS experience, including concepts like layout, specificity, cross browser compatibility, and accessibility\n- 5+ years experience with browser APIs and optimizing front end performance\n- Experience with React\n- BS/MS in Computer Science or a related technical field\n\n            Facebook is proud to be an Equal Opportunity and Affirmative Action employer. We do not discriminate based upon race, religion, color, national origin, sex (including pregnancy, childbirth, or related medical conditions), sexual orientation, gender, gender identity, gender expression, transgender status, sexual stereotypes, age, status as a protected veteran, status as an individual with a disability, or other applicable legally protected characteristics. We also consider qualified applicants with criminal histories, consistent with applicable federal, state and local law.\n\n            Facebook is committed to providing reasonable accommodations for candidates with disabilities in our recruiting process. If you need any assistance or accommodations due to a disability, please let us know at accommodations-ext@fb.com.','Information Technology','fb@fbfb.com','2020-06-10 10:36:19','Mid-Senior Level','United States','California','Menlo Park','active'),(5028,21,'Admin Specialist','Facebook\'s mission is to give people the power to build community and bring the world closer together. Through our family of apps and services, we\'re building a different kind of company that connects billions of people around the world, gives them ways to share what matters most to them, and helps bring people closer together. Whether we\'re creating new products or helping a small business expand its reach, people at Facebook are builders at heart. Our global teams are constantly iterating, solving problems, and working together to empower people around the world to build community and connect in meaningful ways. Together, we can help people build stronger communities - we\'re just getting started.\nFacebook is seeking an Administrative Specialist to join our Global Administrative Specialist program team. This role will support complex and high-volume calendaring, travel planning, and managing expense reports for a number of clients. Our team has a large base in Austin, with plans to expand globally. The Admin Specialists provide remote support to clients across the Company and its locations.\n\nThis position is full-time and based in Austin, TX.\n- Provide remote high-volume calendaring, travel, and expense support\n- Provide Admin services during designated support hours\n- Manage complex calendars for multiple clients\n- Schedule internal and external meetings for multiple clients\n- Schedule and manage recurring and ad-hoc meetings and room bookings across campuses\n- Learn and utilize internal and external tools to provide calendar support\n- Establish ongoing relationship and communications with clients to learn business priorities and apply to support\n- Partner with clients and other Administrative Assistants for meeting coordination\n- Provide proactive time management recommendations to clients\n- Coordinate domestic and international travel arrangements via Concur\n- Prepare and submit corporate card expense reports\n- Maintain program scope of support within agreed-upon service level agreements\n- Educate and inform clients on program goals, scope and service level agreements\n- Draft and send communications to clients about transitions or changes in support\n- Provide coverage support for Admin Specialist colleagues\n- Collaborate with global Admin Specialist colleagues on best practices and knowledge sharing\n- 2+ years of experience providing administrative support to 2 or more executives\n- 2+ years of experience managing calendars for 2 or more executives\n- 1+ years of experience coordinating travel logistics on behalf of 2 or more executives\n- 1+ years of experience managing expense reports\n- Experience prioritizing multiple tasks and activities\n- Experience with Microsoft Office\n- Experience exercising judgment and discretion while utilizing company policies and practices to determine appropriate action\n- 1+ years customer service experience\n- 1+ years high-volume coordination experience (shared services, recruiting coordination)\n- Experience building relationships across a larger company\n- Facebook is proud to be an Equal Opportunity and Affirmative -Action employer. We do not discriminate based upon race, religion, color, national origin, sex (including pregnancy, childbirth, or related medical conditions), sexual orientation, gender, gender identity, gender expression, transgender status, sexual stereotypes, age, status as a protected veteran, status as an individual with a disability, or other applicable legally protected characteristics. We also consider qualified applicants with criminal histories, consistent with applicable federal, state and local law.\n\nFacebook is committed to providing reasonable accommodations for candidates with disabilities in our recruiting process. If you need any assistance or accommodations due to a disability, please let us know at accommodations-ext@fb.com.\n','Finance','fb@fbfb.com','2020-06-10 11:18:02','Senior Level','United States','Texas','Austin','active');
